import React, { Fragment, useEffect } from "react";
import {useQuery, gql} from '@apollo/client'
import "./Wallpaper.css"

export default function Wallpaper(){
    const WALLPAPER = gql`
    {
        Page(page: 1, perPage: 48) {
            media(sort: POPULARITY_DESC, isAdult: false, type: ANIME) {
                coverImage{
                    extraLarge
                }
                bannerImage
            }
        }
    }
    `;

    const {error, loading, data} = useQuery(WALLPAPER);

    useEffect(()=>{
       }, [data]
    );

    /*
    {data.Page.media.map((img) => (
            <img src={img.bannerImage}/>
        ))}
    */
    if (loading) return <p>Loading1...</p>
    else if (error) return <p>Error1 :(</p>
    else{
    return(
        <Fragment>
            <div className="img-wrapper">
                <div className="img-overlay"></div>
                <div className="img-box">
                    <img className="wallpaper-img" src={data.Page.media[0].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[1].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[2].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[3].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[4].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[5].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[6].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[7].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[8].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[9].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[10].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[11].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[12].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[13].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[14].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[15].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[16].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[17].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[18].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[19].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[20].bannerImage}/>
                    <img className="wallpaper-img" src={data.Page.media[21].bannerImage}/>
                </div>
            </div>

        </Fragment>

    );}
}
